CREATE SCHEMA claims;
SET search_path TO claims;

create table members (
	id INT,
	first_name VARCHAR(50),
	last_name VARCHAR(50),
	address VARCHAR(50),
	address_city VARCHAR(10),
	address_country VARCHAR(10),
	insurance_company VARCHAR(25),
	insurance_number VARCHAR(50),
	--Avoiding temporal data types purely for the sake of convenience, given the existing limitations.
	ts_created VARCHAR(20) DEFAULT TO_CHAR(CURRENT_TIMESTAMP,'YYYY-MM-DD HH:MI:SS'),
	ts_updated VARCHAR(20) DEFAULT TO_CHAR(CURRENT_TIMESTAMP,'YYYY-MM-DD HH:MI:SS'),
	PRIMARY KEY(id)
);

ALTER TABLE members REPLICA IDENTITY FULL;

CREATE TABLE accident_claims (
	claim_id SERIAL,
	--claim_total DECIMAL(6,2),
	claim_total FLOAT,
	claim_total_receipt VARCHAR(50),
	claim_currency VARCHAR(3),
	member_id INT,
	--Avoiding temporal data types purely for the sake of convenience, given the existing limitations.
	accident_date VARCHAR(20),
	accident_type VARCHAR(20),
	accident_detail VARCHAR(20),
	--Avoiding temporal data types purely for the sake of convenience, given the existing limitations.
	claim_date VARCHAR(20),
	claim_status VARCHAR(10),
	--Avoiding temporal data types purely for the sake of convenience, given the existing limitations.
	ts_created VARCHAR(20) DEFAULT TO_CHAR(CURRENT_TIMESTAMP,'YYYY-MM-DD HH:MI:SS'),
	ts_updated VARCHAR(20) DEFAULT TO_CHAR(CURRENT_TIMESTAMP,'YYYY-MM-DD HH:MI:SS'),
	PRIMARY KEY(claim_id),
	CONSTRAINT fk_member
      FOREIGN KEY(member_id) 
	  REFERENCES members(id)
	  ON DELETE SET NULL
);

ALTER TABLE accident_claims REPLICA IDENTITY FULL;


COMMIT;


COMMIT;
